import React from "react";
import ReactDOM from "react-dom";
import "./css/index.css";
import App from "./HomeHeader";
// import Icons from "./HomeBlocks";
import HomeSlider from "./HomeSlider";
import * as serviceWorker from "./serviceWorker";
ReactDOM.render(<App />, document.getElementById("HomeHeader"));
ReactDOM.render(<Banner />, document.getElementById("HomeSlider"));
// ReactDOM.render(<Icons />, document.getElementById("HomeBlocks"));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
